issue.body:
The [PreviewSupport](https://github.com/bpmn-io/diagram-js/blob/develop/lib/features/preview-support/PreviewSupport.js#L106) feature clones an SVG and then applies `fill` and `stroke` on all of its elements. This leads to rendering errors like:

![image](https://github.com/bpmn-io/diagram-js/assets/7633572/604b18a5-7d7c-4528-8fda-c9119fa88ba7)

A better way of rendering the preview would be to render the element using the renderer but with [custom colors](https://github.com/bpmn-io/bpmn-js/pull/1985):

```javascript
graphicsFactory.drawShape(getVisual(gfx), element, {
  fill: 'red',
  stroke: 'green'
});
```
